        buffer[1] = "x";
        for (uint256 i = 2 * length + 1; i > 1; --i) {
            buffer[i] = _SYMBOLS[value & 0xf];
            value >>= 4;
        }
        require(value == 0, "Strings: hex length insufficient");
        return string(buffer);
    }

    /**
     * @dev Converts an `address` with fixed length of 20 bytes to its not checksummed ASCII `string` hexadecimal representation.
     */
    function toHexString(address addr) internal pure returns (string memory) {
        return toHexString(uint256(uint160(addr)), _ADDRESS_LENGTH);
    }

    /**
     * @dev Returns true if the two strings are equal.
     */
    function equal(string memory a, string memory b) internal pure returns (bool) {
        return keccak256(bytes(a)) == keccak256(bytes(b));
    }
}

contracts/AutophageToken.sol.content:
// SPDX-License-Identifier: Apache-2.0
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

/**
 * @title AutophageToken
 * @notice Multi-species token contract implementing lazy decay evaluation
 * @dev Core token contract for the Autophage Protocol with four token species
 * 
 * Token Species:
 * - Rhythm (0): 5% daily decay for exercise/medication
 * - Healing (1): 0.75% daily decay for therapy/recovery
 * - Foundation (2): 0.1% daily decay for preventive care
 * - Catalyst (3): 2-10% dynamic decay for marketplace balance
 */
contract AutophageToken is AccessControl, ReentrancyGuard, Pausable {
    // Constants
    uint256 private constant PRECISION = 1e18;
    uint256 private constant SECONDS_PER_DAY = 86400;
    uint256 private constant MAX_SPECIES = 4;

    // Token species identifiers
    uint8 public constant RHYTHM = 0;
    uint8 public constant HEALING = 1;
    uint8 public constant FOUNDATION = 2;
    uint8 public constant CATALYST = 3;

    // Roles
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    bytes32 public constant RESERVOIR_ROLE = keccak256("RESERVOIR_ROLE");
    bytes32 public constant GOVERNANCE_ROLE = keccak256("GOVERNANCE_ROLE");

    // Packed struct for efficient storage (uses single storage slot)
    struct Balance {
        uint128 amount;      // Token balance
        uint64 lastUpdate;   // Timestamp of last update
        uint64 lockedUntil;  // For wellness vault functionality
    }

    // State variables
    mapping(address => mapping(uint8 => Balance)) private balances;
    mapping(uint8 => uint256) public decayRates; // Daily decay rates (scaled by PRECISION)
    mapping(uint8 => uint256) public totalSupply; // Total supply per species

    // Whale protection thresholds
    mapping(uint8 => uint256[]) public whaleThresholds;
    mapping(uint8 => uint256[]) public whaleMultipliers;

    // Events
    event Transfer(
        address indexed from,
        address indexed to,
        uint8 indexed species,
        uint256 amount,
        uint256 decayAmount
    );
    event Mint(address indexed to, uint8 indexed species, uint256 amount);
    event DecayApplied(address indexed user, uint8 indexed species, uint256 amount);
    event VaultLocked(address indexed user, uint8 indexed species, uint256 amount, uint256 lockDuration);
    event DecayRateUpdated(uint8 indexed species, uint256 oldRate, uint256 newRate);

    constructor() {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(GOVERNANCE_ROLE, msg.sender);

        // Initialize decay rates from the litepaper
        decayRates[RHYTHM] = 50000000000000000; // 5% = 0.05 * 1e18
        decayRates[HEALING] = 7500000000000000; // 0.75% = 0.0075 * 1e18
        decayRates[FOUNDATION] = 1000000000000000; // 0.1% = 0.001 * 1e18
        decayRates[CATALYST] = 50000000000000000; // 5% default, dynamic in practice

        // Initialize whale protection for Rhythm tokens
        whaleThresholds[RHYTHM] = [10000 * PRECISION, 50000 * PRECISION, 100000 * PRECISION];
        whaleMultipliers[RHYTHM] = [PRECISION, 1500000000000000000, 2000000000000000000, 3000000000000000000]; // 1x, 1.5x, 2x, 3x
    }

    /**
     * @notice Get balance with lazy decay calculation
     * @dev Only calculates decay when balance is accessed
     * @param user Address of the user
     * @param species Token species ID (0-3)
     * @return Current balance after decay
     */
    function balanceOf(address user, uint8 species) public view returns (uint256) {
        require(species < MAX_SPECIES, "Invalid species");

        Balance memory bal = balances[user][species];
        if (bal.amount == 0) return 0;

        // If locked in wellness vault, use reduced decay
        if (bal.lockedUntil > block.timestamp) {
            return _calculateVaultBalance(bal, species);
        }

        uint256 timePassed = block.timestamp - bal.lastUpdate;
        uint256 daysPassed = timePassed / SECONDS_PER_DAY;

        if (daysPassed == 0) return bal.amount;

        // Apply decay with whale protection
        uint256 effectiveDecayRate = _getEffectiveDecayRate(user, species, bal.amount);
        uint256 decayedBalance = _applyDecay(bal.amount, effectiveDecayRate, daysPassed);

        return decayedBalance;
    }

    /**
     * @notice Transfer tokens with automatic decay application
     * @dev Updates balances lazily to save gas
     */
    function transfer(address to, uint8 species, uint256 amount) 
        external 
        nonReentrant 
        whenNotPaused 
        returns (bool) 
    {
        require(to != address(0), "Invalid recipient");
        require(species < MAX_SPECIES, "Invalid species");

        // Apply decay and get current balance
        uint256 senderBalance = _updateBalance(msg.sender, species);
        require(senderBalance >= amount, "Insufficient balance");

        // Check if tokens are locked
        require(balances[msg.sender][species].lockedUntil <= block.timestamp, "Tokens locked in vault");

        // Update sender balance
        balances[msg.sender][species].amount = uint128(senderBalance - amount);
        balances[msg.sender][species].lastUpdate = uint64(block.timestamp);

        // Update recipient balance
        uint256 recipientBalance = _updateBalance(to, species);
        balances[to][species].amount = uint128(recipientBalance + amount);
        balances[to][species].lastUpdate = uint64(block.timestamp);

        // Calculate decay amount for event
        uint256 decayAmount = _calculateDecayAmount(msg.sender, species);

        emit Transfer(msg.sender, to, species, amount, decayAmount);
        return true;
    }

    /**
     * @notice Mint new tokens (restricted to authorized minters)
     * @dev Called by verification engine after proof validation
     */
    function mint(address to, uint8 species, uint256 amount) 
        external 
        onlyRole(MINTER_ROLE) 
        whenNotPaused 
    {
        require(to != address(0), "Invalid recipient");
        require(species < MAX_SPECIES, "Invalid species");
        require(amount > 0, "Amount must be positive");

        uint256 currentBalance = _updateBalance(to, species);
        balances[to][species].amount = uint128(currentBalance + amount);
        balances[to][species].lastUpdate = uint64(block.timestamp);

        totalSupply[species] += amount;

        emit Mint(to, species, amount);
    }

    /**
     * @notice Lock tokens in wellness vault for reduced decay
     * @dev Implements time-locked savings with configurable decay reduction
     */
    function lockInVault(uint8 species, uint256 amount, uint256 lockDays) 
        external 
        nonReentrant 
        whenNotPaused 
    {
        require(species < MAX_SPECIES, "Invalid species");
        require(lockDays >= 30 && lockDays <= 365, "Lock period must be 30-365 days");
        require(amount > 0, "Amount must be positive");

        uint256 currentBalance = _updateBalance(msg.sender, species);
        require(currentBalance >= amount, "Insufficient balance");
        require(balances[msg.sender][species].lockedUntil <= block.timestamp, "Already locked");

        uint256 lockDuration = lockDays * SECONDS_PER_DAY;
        balances[msg.sender][species].lockedUntil = uint64(block.timestamp + lockDuration);

        emit VaultLocked(msg.sender, species, amount, lockDuration);
    }

    /**
     * @notice Collect decayed tokens for the Reservoir
     * @dev Called periodically by Reservoir contract
     */
    function collectDecay(address[] calldata users, uint8[] calldata species) 
        external 
        onlyRole(RESERVOIR_ROLE) 
        returns (uint256 totalDecayed) 
    {
        require(users.length == species.length, "Array length mismatch");

        for (uint256 i = 0; i < users.length; i++) {
            uint256 decayAmount = _calculateDecayAmount(users[i], species[i]);
            if (decayAmount > 0) {
                _updateBalance(users[i], species[i]);
                totalDecayed += decayAmount;
            }
        }

        return totalDecayed;
    }

    /**
     * @notice Update decay rate for dynamic adjustment (Catalyst tokens)
     * @dev Only callable by governance after on-chain experiment validation
     */
    function updateDecayRate(uint8 species, uint256 newRate) 
        external 
        onlyRole(GOVERNANCE_ROLE) 
    {
        require(species < MAX_SPECIES, "Invalid species");
        require(newRate <= 100000000000000000, "Rate too high"); // Max 10%

        uint256 oldRate = decayRates[species];
        decayRates[species] = newRate;

        emit DecayRateUpdated(species, oldRate, newRate);
    }

    /**
     * @notice Get all balances for a user
     * @dev Convenience function for UI
     */
    function getAllBalances(address user) external view returns (uint256[4] memory) {
        return [
            balanceOf(user, RHYTHM),
            balanceOf(user, HEALING),
            balanceOf(user, FOUNDATION),
            balanceOf(user, CATALYST)
        ];
    }

    // Internal functions

    function _updateBalance(address user, uint8 species) internal returns (uint256) {
        Balance storage bal = balances[user][species];

        if (bal.amount == 0) {
            bal.lastUpdate = uint64(block.timestamp);
            return 0;
        }

        uint256 currentBalance = balanceOf(user, species);
        uint256 decayAmount = bal.amount - currentBalance;

        if (decayAmount > 0) {
            emit DecayApplied(user, species, decayAmount);
            // Decayed tokens would be tracked for Reservoir collection
        }

        bal.amount = uint128(currentBalance);
        bal.lastUpdate = uint64(block.timestamp);

        return currentBalance;
    }

    function _calculateDecayAmount(address user, uint8 species) internal view returns (uint256) {
        Balance memory bal = balances[user][species];
        if (bal.amount == 0) return 0;

        uint256 currentBalance = balanceOf(user, species);
        return bal.amount > currentBalance ? bal.amount - currentBalance : 0;
    }

    function _applyDecay(uint256 balance, uint256 dailyDecayRate, uint256 daysPassed) 
        internal 
        pure 
        returns (uint256) 
    {
        if (daysPassed == 0 || dailyDecayRate == 0) return balance;

        // Calculate (1 - decayRate)^daysPassed
        uint256 retentionRate = PRECISION - dailyDecayRate;
        uint256 decayFactor = _pow(retentionRate, daysPassed, PRECISION);

        return (balance * decayFactor) / _pow(PRECISION, daysPassed, PRECISION);
    }

    function _getEffectiveDecayRate(address user, uint8 species, uint256 balance) 
        internal 
        view 
        returns (uint256) 
    {
        if (species != RHYTHM || whaleThresholds[species].length == 0) {
            return decayRates[species];
        }

        // Apply progressive whale protection
        uint256[] memory thresholds = whaleThresholds[species];
        uint256[] memory multipliers = whaleMultipliers[species];

        for (uint256 i = thresholds.length; i > 0; i--) {
            if (balance >= thresholds[i - 1]) {
                return (decayRates[species] * multipliers[i]) / PRECISION;
            }
        }

        return decayRates[species];
    }

    function _calculateVaultBalance(Balance memory bal, uint8 species) 
        internal 
        view 
        returns (uint256) 
    {
        uint256 lockDuration = bal.lockedUntil - bal.lastUpdate;
        uint256 lockDays = lockDuration / SECONDS_PER_DAY;

        // Calculate decay reduction based on lock duration
        uint256 reductionFactor = _getVaultReductionFactor(lockDays);
        uint256 reducedDecayRate = (decayRates[species] * (PRECISION - reductionFactor)) / PRECISION;

        uint256 timePassed = block.timestamp - bal.lastUpdate;
        uint256 daysPassed = timePassed / SECONDS_PER_DAY;

        return _applyDecay(bal.amount, reducedDecayRate, daysPassed);
    }

    function _getVaultReductionFactor(uint256 lockDays) internal pure returns (uint256) {
        if (lockDays >= 365) return 900000000000000000; // 90% reduction
        if (lockDays >= 180) return 450000000000000000; // 45% reduction
        if (lockDays >= 90) return 270000000000000000;  // 27% reduction
        return 90000000000000000; // 9% reduction for 30 days
    }

    /**
     * @dev Efficient power function for decay calculations
     */
    function _pow(uint256 base, uint256 exponent, uint256 precision) 
        internal 
        pure 
        returns (uint256) 
    {
        if (exponent == 0) return precision;
        if (exponent == 1) return base;

        uint256 result = precision;
        uint256 currentBase = base;

        while (exponent > 0) {
            if (exponent & 1 == 1) {
                result = (result * currentBase) / precision;
            }
            currentBase = (currentBase * currentBase) / precision;
            exponent >>= 1;
        }

        return result;
    }

    // Emergency functions

    function pause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _pause();
    }

    function unpause() external onlyRole(DEFAULT_ADMIN_ROLE) {
        _unpause();
    }
}

contracts/GovernanceContract.sol.content:
// SPDX-License-Identifier: Apache-2.0
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./interfaces/IAutophageToken.sol";

/**
 * @title GovernanceContract
 * @notice Empirical governance through on-chain experiments
 * @dev Implements contribution-based voting and statistical validation
 * 
 * Governance principles:
 * - All changes require empirical validation
 * - Voting weight based on lifetime contributions, not current holdings
 * - On-chain A/B testing with statistical significance
 * - Automatic sunset of unused features
 */
contract GovernanceContract is AccessControl, ReentrancyGuard {
    using SafeERC20 for IERC20;

    // Constants
    uint256 private constant PRECISION = 1e18;
    uint256 private constant MIN_IMPROVEMENT = 5; // 5% minimum improvement
    uint256 private constant SIGNIFICANCE_LEVEL = 5; // p < 0.05
    uint256 private constant MIN_EXPERIMENT_DURATION = 7 days;
    uint256 private constant MAX_EXPERIMENT_DURATION = 90 days;
    uint256 private constant PROPOSAL_STAKE = 500 * PRECISION; // 500 Catalyst tokens

    // Roles
    bytes32 public constant ORACLE_ROLE = keccak256("ORACLE_ROLE");
    bytes32 public constant EXPERIMENT_ROLE = keccak256("EXPERIMENT_ROLE");

    // Proposal types
    enum ProposalType {
        PARAMETER_CHANGE,
        FEATURE_ADDITION,
        FEATURE_REMOVAL,
        ECONOMIC_ADJUSTMENT,
        EMERGENCY_ACTION
    }

    // Experiment structure
    struct Experiment {
        uint256 proposalId;
        uint256 startTime;
        uint256 endTime;
        uint256 controlGroup;      // Number of users in control
        uint256 treatmentGroup;    // Number of users in treatment
        bytes32 hypothesis;        // What we're testing
        bytes32 metricHash;        // What we're measuring
        bool isActive;
        mapping(address => bool) isInTreatment;
    }

    // Proposal structure
    struct Proposal {
        address proposer;
        ProposalType proposalType;
        string title;
        string description;
        bytes callData;            // Encoded function call
        uint256 stakeAmount;
        uint256 votesFor;
        uint256 votesAgainst;
        uint256 experimentId;
        bool executed;
        bool cancelled;
        uint256 createdAt;
        uint256 executedAt;
    }

    // Contribution scoring
    struct ContributionScore {
        uint256 lifetimeReservoirContribution;
        uint256 verificationAccuracy;
        uint256 governanceParticipation;
        uint256 lastUpdated;
    }

    // State variables
    IAutophageToken public autophageToken;
    IERC20 public catalystToken;

    mapping(uint256 => Proposal) public proposals;
    mapping(uint256 => Experiment) public experiments;
    mapping(address => ContributionScore) public contributionScores;
    mapping(address => mapping(uint256 => bool)) public hasVoted;
    mapping(uint256 => mapping(address => uint256)) public voteWeight;

    uint256 public nextProposalId;
    uint256 public nextExperimentId;
    uint256 public totalContributions;

    // Feature usage tracking for automatic sunset
    mapping(bytes32 => uint256) public featureLastUsed;
    mapping(bytes32 => uint256) public featureUsageCount;

    // Events
    event ProposalCreated(
        uint256 indexed proposalId,
        address indexed proposer,
        ProposalType proposalType,
        string title
    );
    event VoteCast(
        uint256 indexed proposalId,
        address indexed voter,
        bool support,
        uint256 weight
    );
    event ExperimentStarted(
        uint256 indexed experimentId,
        uint256 indexed proposalId,
        uint256 duration
    );
    event ExperimentCompleted(
        uint256 indexed experimentId,
        bool success,
        uint256 improvement,
        uint256 pValue
    );
    event ProposalExecuted(uint256 indexed proposalId, bool success);
    event FeatureSunset(bytes32 indexed featureId, uint256 lastUsed);

    constructor(address _token, address _catalyst) {
        autophageToken = IAutophageToken(_token);
        catalystToken = IERC20(_catalyst);

        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(ORACLE_ROLE, msg.sender);
    }

    /**
     * @notice Create a new governance proposal
     * @dev Requires staking Catalyst tokens
     */
    function createProposal(
        ProposalType proposalType,
        string calldata title,
        string calldata description,
        bytes calldata callData
    ) external nonReentrant returns (uint256 proposalId) {
        require(bytes(title).length > 0, "Empty title");
        require(bytes(description).length > 0, "Empty description");

        // Stake Catalyst tokens
        catalystToken.safeTransferFrom(msg.sender, address(this), PROPOSAL_STAKE);

        proposalId = nextProposalId++;

        Proposal storage proposal = proposals[proposalId];
        proposal.proposer = msg.sender;
        proposal.proposalType = proposalType;
        proposal.title = title;
        proposal.description = description;
        proposal.callData = callData;
        proposal.stakeAmount = PROPOSAL_STAKE;
        proposal.createdAt = block.timestamp;

        emit ProposalCreated(proposalId, msg.sender, proposalType, title);

        return proposalId;
    }

    /**
     * @notice Vote on a proposal using contribution-based weight
     * @dev Weight calculated from lifetime protocol contributions
     */
    function vote(uint256 proposalId, bool support) external nonReentrant {
        Proposal storage proposal = proposals[proposalId];
        require(proposal.createdAt > 0, "Invalid proposal");
        require(!proposal.executed && !proposal.cancelled, "Proposal finalized");
        require(!hasVoted[msg.sender][proposalId], "Already voted");

        // Calculate voting weight
        uint256 weight = _calculateVotingWeight(msg.sender);
        require(weight > 0, "No voting power");

        // Record vote
        hasVoted[msg.sender][proposalId] = true;
        voteWeight[proposalId][msg.sender] = weight;

        if (support) {
            proposal.votesFor += weight;
        } else {
            proposal.votesAgainst += weight;
        }

        emit VoteCast(proposalId, msg.sender, support, weight);
    }

    /**
     * @notice Start an experiment for a proposal
     * @dev Creates control and treatment groups for A/B testing
     */
    function startExperiment(
        uint256 proposalId,
        uint256 duration,
        bytes32 hypothesis,
        bytes32 metricHash
    ) external onlyRole(EXPERIMENT_ROLE) {
        Proposal storage proposal = proposals[proposalId];
        require(proposal.createdAt > 0, "Invalid proposal");
        require(!proposal.executed && !proposal.cancelled, "Proposal finalized");
        require(proposal.votesFor > proposal.votesAgainst, "Insufficient support");
        require(duration >= MIN_EXPERIMENT_DURATION && duration <= MAX_EXPERIMENT_DURATION, 
                "Invalid duration");

        uint256 experimentId = nextExperimentId++;
        proposal.experimentId = experimentId;

        Experiment storage experiment = experiments[experimentId];
        experiment.proposalId = proposalId;
        experiment.startTime = block.timestamp;
        experiment.endTime = block.timestamp + duration;
        experiment.hypothesis = hypothesis;
        experiment.metricHash = metricHash;
        experiment.isActive = true;

        emit ExperimentStarted(experimentId, proposalId, duration);
    }

    /**
     * @notice Assign users to experiment groups
     * @dev Random assignment ensuring statistical validity
     */
    function assignToExperiment(
        uint256 experimentId,
        address[] calldata users,
        bool[] calldata treatment
    ) external onlyRole(ORACLE_ROLE) {
        require(users.length == treatment.length, "Array mismatch");

        Experiment storage experiment = experiments[experimentId];
        require(experiment.isActive, "Experiment not active");
        require(block.timestamp < experiment.endTime, "Experiment ended");

        for (uint256 i = 0; i < users.length; i++) {
            if (treatment[i]) {
                experiment.isInTreatment[users[i]] = true;
                experiment.treatmentGroup++;
            } else {
                experiment.controlGroup++;
            }
        }
    }

    /**
     * @notice Complete experiment and evaluate results
     * @dev Validates statistical significance of outcomes
     */
    function completeExperiment(
        uint256 experimentId,
        uint256 controlMetric,
        uint256 treatmentMetric,
        uint256 pValue
    ) external onlyRole(ORACLE_ROLE) {
        Experiment storage experiment = experiments[experimentId];
        require(experiment.isActive, "Experiment not active");
        require(block.timestamp >= experiment.endTime, "Experiment not ended");

        experiment.isActive = false;

        // Calculate improvement
        uint256 improvement = 0;
        if (treatmentMetric > controlMetric && controlMetric > 0) {
            improvement = ((treatmentMetric - controlMetric) * 100) / controlMetric;
        }

        // Check success criteria
        bool success = improvement >= MIN_IMPROVEMENT && pValue < SIGNIFICANCE_LEVEL;

        emit ExperimentCompleted(experimentId, success, improvement, pValue);

        if (success) {
            // Execute proposal
            _executeProposal(experiment.proposalId);
        } else {
            // Return stake minus penalty
            Proposal storage proposal = proposals[experiment.proposalId];
            uint256 penalty = proposal.stakeAmount / 10; // 10% penalty
            catalystToken.safeTransfer(proposal.proposer, proposal.stakeAmount - penalty);
            proposal.cancelled = true;
        }
    }

    /**
     * @notice Update contribution score for a user
     * @dev Called by various protocol components
     */
    function updateContributionScore(
        address user,
        uint256 reservoirContribution,
        uint256 verificationAccuracy,
        uint256 governanceParticipation
    ) external onlyRole(ORACLE_ROLE) {
        ContributionScore storage score = contributionScores[user];

        score.lifetimeReservoirContribution += reservoirContribution;
        score.verificationAccuracy = 
            (score.verificationAccuracy + verificationAccuracy) / 2; // Running average
        score.governanceParticipation += governanceParticipation;
        score.lastUpdated = block.timestamp;

        totalContributions += reservoirContribution;
    }

    /**
     * @notice Track feature usage for automatic sunset
     * @dev Features unused for 180 days are automatically disabled
     */
    function trackFeatureUsage(bytes32 featureId) external {
        featureLastUsed[featureId] = block.timestamp;
        featureUsageCount[featureId]++;
    }

    /**
     * @notice Check and sunset unused features
     * @dev Can be called by anyone to clean up unused features
     */
    function sunsetUnusedFeatures(bytes32[] calldata featureIds) external {
        for (uint256 i = 0; i < featureIds.length; i++) {
            bytes32 featureId = featureIds[i];

            // Check if feature is unused for 180 days
            if (featureLastUsed[featureId] > 0 && 
                block.timestamp > featureLastUsed[featureId] + 180 days) {

                // Check if usage is below 1% threshold
                uint256 usage = featureUsageCount[featureId];
                uint256 totalUsage = _getTotalFeatureUsage();

                if (usage * 100 < totalUsage) {
                    // Sunset the feature
                    featureLastUsed[featureId] = 0;
                    emit FeatureSunset(featureId, featureLastUsed[featureId]);
                }
            }
        }
    }

    /**
     * @notice Emergency proposal execution
     * @dev Only for critical security issues, requires multi-sig
     */
    function emergencyExecute(uint256 proposalId) 
        external 
        onlyRole(DEFAULT_ADMIN_ROLE) 
    {
        Proposal storage proposal = proposals[proposalId];
        require(proposal.proposalType == ProposalType.EMERGENCY_ACTION, "Not emergency");
        require(!proposal.executed, "Already executed");

        _executeProposal(proposalId);
    }

    // Internal functions

    function _calculateVotingWeight(address user) internal view returns (uint256) {
        ContributionScore memory score = contributionScores[user];

        // Weight formula from litepaper
        uint256 w1 = 5; // 50% weight for lifetime contributions
        uint256 w2 = 3; // 30% weight for accuracy
        uint256 w3 = 2; // 20% weight for participation

        uint256 contributionComponent = 
            (w1 * _log10(score.lifetimeReservoirContribution + PRECISION)) / 10;
        uint256 accuracyComponent = 
            (w2 * score.verificationAccuracy) / 100;
        uint256 participationComponent = 
            (w3 * score.governanceParticipation) / 10;

        uint256 totalScore = 
            contributionComponent + accuracyComponent + participationComponent;

        // Convert to voting power (quadratic)
        return _sqrt(totalScore * PRECISION);
    }

    function _executeProposal(uint256 proposalId) internal {
        Proposal storage proposal = proposals[proposalId];
        require(!proposal.executed, "Already executed");

        proposal.executed = true;
        proposal.executedAt = block.timestamp;

        // Execute the proposal
        (bool success,) = address(this).call(proposal.callData);

        emit ProposalExecuted(proposalId, success);

        if (success) {
            // Return stake with bonus
            uint256 bonus = 100 * PRECISION; // 100 USDC equivalent
            catalystToken.safeTransfer(proposal.proposer, proposal.stakeAmount);
            // Bonus would be paid in USDC from Reservoir
        }
    }

    function _getTotalFeatureUsage() internal view returns (uint256) {
        // Placeholder - would sum all feature usage
        return 1000000;
    }

    function _log10(uint256 x) internal pure returns (uint256) {
        if (x >= 10**18) return 18;
        if (x >= 10**17) return 17;
        if (x >= 10**16) return 16;
        if (x >= 10**15) return 15;
        if (x >= 10**14) return 14;
        if (x >= 10**13) return 13;
        if (x >= 10**12) return 12;
        if (x >= 10**11) return 11;
        if (x >= 10**10) return 10;
        if (x >= 10**9) return 9;
        if (x >= 10**8) return 8;
        if (x >= 10**7) return 7;
        if (x >= 10**6) return 6;
        if (x >= 10**5) return 5;
        if (x >= 10**4) return 4;
        if (x >= 10**3) return 3;
        if (x >= 10**2) return 2;
        if (x >= 10**1) return 1;
        return 0;
    }

    function _sqrt(uint256 x) internal pure returns (uint256) {
        if (x == 0) return 0;

        uint256 z = (x + 1) / 2;
        uint256 y = x;

        while (z < y) {
            y = z;
            z = (x / z + z) / 2;
        }

        return y;
    }

    // View functions

    function getProposal(uint256 proposalId) external view returns (
        address proposer,
        ProposalType proposalType,
        string memory title,
        uint256 votesFor,
        uint256 votesAgainst,
        bool executed,
        bool cancelled
    ) {
        Proposal storage proposal = proposals[proposalId];
        return (
            proposal.proposer,
            proposal.proposalType,
            proposal.title,
            proposal.votesFor,
            proposal.votesAgainst,
            proposal.executed,
            proposal.cancelled
        );
    }

    function getExperiment(uint256 experimentId) external view returns (
        uint256 proposalId,
        uint256 startTime,
        uint256 endTime,
        uint256 controlGroup,
        uint256 treatmentGroup,
        bool isActive
    ) {
        Experiment storage experiment = experiments[experimentId];
        return (
            experiment.proposalId,
            experiment.startTime,
            experiment.endTime,
            experiment.controlGroup,
            experiment.treatmentGroup,
            experiment.isActive
        );
    }

    function getUserVotingPower(address user) external view returns (uint256) {
        return _calculateVotingWeight(user);
    }
}

